import React, { Component } from "react";
import { Button, Checkbox, Form, Dimmer } from "semantic-ui-react";

const options = [
  { key: "w", text: "Won", value: "won" },
  { key: "l", text: "Loss", value: "loss" },
  { key: "d", text: "Draw", value: "draw" },
  { key: "l", text: "Leave/Disconnect", value: "leave" }
];

class Record extends Component {
  render(options) {
    return (
      <Form>
        <Form.Select fluid label="Result" options={options} />
        <Form.Input
          fluid
          label="Current Ranking"
          placeholder="Current Ranking"
        />
        <Button type="submit">Submit</Button>
      </Form>
    );
  }
}

export default Record;
